---------------------- MYSQL ------------------------
CREATE TABLE TB_UC3M_INV_JUST_CONC_ENTIDAD (
  NUMIDCONCEPTOENTIDAD  INT				    NOT NULL AUTO_INCREMENT COMMENT 'Identificador interno del código de la entidad para la ayuda',	
  STRCTPCON             VARCHAR(2)    NOT NULL COMMENT 'Valor del campo CTPCON del concepto de la entidad según documento de ayuda',
  STRCTPSCO             VARCHAR(2)    NOT NULL COMMENT 'Valor del campo CTPSCO del concepto de la entidad según documento de ayuda',
  NUMIDTIPO             INT				    NOT NULL COMMENT 'Identificador del tipo de ayuda según el documento',
  STRTIPOGASTOMIN       VARCHAR(2000) NOT NULL COMMENT 'Descripción del tipo de gasto según documento de ayuda',
  NUMIDTECNICA          INT				    NULL COMMENT 'Identificador del tipo de gasto de la justificación técnica',
  PRIMARY KEY (NUMIDCONCEPTOENTIDAD),
  FOREIGN KEY JUST_CONCENTIDAD_TEC_FK (NUMIDTECNICA) REFERENCES TB_UC3M_INV_JUST_TECNICA (NUMIDTECNICA),
  FOREIGN KEY JUST_CONCENTIDAD_TIPO_FK (NUMIDTIPO) REFERENCES TB_UC3M_INV_JUST_TIPOS (NUMIDTIPO)
) COMMENT 'Tabla que contiene los valores CTPCON y CTPSCO de cada concepto de la entidad financiadora para los distintos tipos de proyecto';
---------------------- ORACLE ------------------------
CREATE SEQUENCE TECNICOS_INV.JUST_CONCENTIDAD_SQ;

CREATE TABLE TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD (
  NUMIDCONCEPTOENTIDAD  NUMBER(8)       NOT NULL,
  STRCTPCON             VARCHAR2(2)     NOT NULL,
  STRCTPSCO             VARCHAR2(2)     NOT NULL,
  NUMIDTIPO             NUMBER(8)       NOT NULL,
  STRTIPOGASTOMIN       VARCHAR2(2000)  NOT NULL,
  NUMIDTECNICA          NUMBER(8)       NULL
);

COMMENT ON TABLE TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD IS 'Tabla que contiene los valores CTPCON y CTPSCO de cada concepto de la entidad financiadora para los distintos tipos de proyecto.';
COMMENT ON COLUMN TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD.NUMIDCONCEPTOENTIDAD IS 'Identificador interno del código de la entidad para la ayuda.';
COMMENT ON COLUMN TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD.STRCTPCON IS 'Valor del campo CTPCON del concepto de la entidad según documento de ayuda.';
COMMENT ON COLUMN TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD.STRCTPSCO IS 'Valor del campo CTPSCO del concepto de la entidad según documento de ayuda.';
COMMENT ON COLUMN TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD.NUMIDTIPO IS 'Identificador del tipo de ayuda según el documento.';
COMMENT ON COLUMN TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD.STRTIPOGASTOMIN IS 'Descripción del tipo de gasto según documento de ayuda.';
COMMENT ON COLUMN TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD.NUMIDTECNICA IS 'Identificador del tipo de gasto de la justificación técnica.';

CREATE UNIQUE INDEX TECNICOS_INV.JUST_CONCENTIDAD_PK_I ON TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD (NUMIDCONCEPTOENTIDAD);
CREATE INDEX TECNICOS_INV.JUST_CONCENTIDAD_TIPO_FK_I ON TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD (NUMIDTIPO);
CREATE INDEX TECNICOS_INV.JUST_CONCENTIDAD_TEC_FK_I ON TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD (NUMIDTECNICA);

ALTER TABLE TECNICOS_INV.TB_UC3M_INV_JUST_CONC_ENTIDAD ADD (
  CONSTRAINT JUST_CONCENTIDAD_PK
  PRIMARY KEY (NUMIDCONCEPTOENTIDAD)
  USING INDEX TECNICOS_INV.JUST_CONCENTIDAD_PK_I
  ENABLE VALIDATE,
  CONSTRAINT JUST_CONCENTIDAD_TIPO_FK
  FOREIGN KEY (NUMIDTIPO) REFERENCES TECNICOS_INV.TB_UC3M_INV_JUST_TIPOS (NUMIDTIPO)
  ENABLE VALIDATE,
  CONSTRAINT JUST_CONCENTIDAD_TEC_FK
  FOREIGN KEY (NUMIDTECNICA) REFERENCES TECNICOS_INV.TB_UC3M_INV_JUST_TECNICA (NUMIDTECNICA)
  ENABLE VALIDATE
);

CREATE OR REPLACE TRIGGER TG_JUST_CONCENTIDAD_SQ
  BEFORE INSERT 
  ON TB_UC3M_INV_JUST_CONC_ENTIDAD FOR EACH ROW
BEGIN
  IF :new.NUMIDCONCEPTOENTIDAD IS NULL THEN
    SELECT JUST_CONCENTIDAD_SQ.nextval INTO :new.NUMIDCONCEPTOENTIDAD FROM DUAL;
  END IF;
END;
